function getHorseQRDesign(){
	/* PrepaidQR variables start */
	var id = document.getElementById("id").value;
	var strBase64 = document.getElementById("strBase64").value;
	
	if(document.getElementById("petName").value == null || document.getElementById("petName").value == ""){
		var petName = "No name declared";
	}else{
		var petName = document.getElementById("petName").value;
	}
	
	var doc = new jsPDF()
	doc.addFont('Mali', "mali", "normal");
	doc.setFont('mali');
	
	var qr ='data:image/png;base64,'+strBase64;
	var logo = document.getElementById("petqr").src;
	
	/* 100% with and height */
	doc.addImage(qr, 'PNG', 120, 5, 0, 0);
	doc.rect(122, 7, 75.5, 79.5);
	doc.setFontSize(15);
	doc.text(id, 123.5, 85);
	doc.addImage(logo, 153, 40, 12, 12);
	
	doc.addImage(qr, 'PNG', 121, 99, 70, 70);
	doc.rect(122, 100, 68, 71.5);
	doc.setFontSize(13);
	doc.text(id, 123.5, 170);
	doc.addImage(logo, 153, 230, 10, 10);
	
	
	doc.addImage(qr, 'PNG', 121.3, 184, 60, 60);
	doc.rect(121.7, 184, 60, 62.5);
	doc.setFontSize(11.5);
	doc.text(id, 123.7, 244.5);
	doc.addImage(logo, 153, 40, 12, 12);
	
	var sissors = "../img/design/sissors.png"; 
	doc.addImage(sissors,'PNG', 200, 85, 0, 0);
	doc.addImage(sissors,'PNG', 200, 170, 0, 0);
	doc.addImage(sissors,'PNG', 200, 244.5, 0, 0);
	
	doc.text("Horse template for: " + petName, 20,10);
	doc.setFontSize(10);
	doc.text("- This option do not came with backside tag", 23, 15);
	doc.text("- This option comes with coordinates whe it read it", 23, 20);
	doc.text("- This option could be usefull on horse stables", 23, 25  );
	doc.text("- This option works every kind of equins", 23, 30);
	
	/* Reverse start */
	var footerLogo = 'data:image/png;base64,';
	
	/* Footer start */
	var date = Date(Date.now()); 
	var footerMolokotech = '../img/design/molokotechFooterLogo.png';
	doc.setFontSize(10);
	doc.text("Date = " + date.toString(), 1, 255);
	doc.text("Should be laser printed, paper mate or photo paper, plasticizer",1, 260);
	doc.text("Web Access= https://pet-qr.com/id/" + id, 1, 265);
	doc.addImage(footerLogo,'PNG', 1, 267, 23, 0);
	doc.text("is Powered by ", 26, 271);
	doc.addImage(footerMolokotech,'PNG', 51, 267, 34 , 0);
	/* Footer end */
	
	/* Finally saves it */
	doc.save('petQR_HorseDesign_a4.pdf');
}